import React, {Component} from 'react';


class Product extends Component {
    render(){
        return(
            <div className="Product">
                <h2 className="Product-title">Gift Card</h2>
                <div className="Product-price">Amount: ${this.props.card.price}</div>
                <button className="Product-buy-button" onClick={this.props.onAddToCartClick}>
                    Add to cart
                </button>
            </div>
        )
    }
}




export default Product;
